  iframe.style.cssText = `
    position:fixed;
    left:0px;
    right:0px;
    top:0px;
    bottom:0px;
    border:0px;
    width:100%;
    height:100%;
  `;

  document.body.innerHTML = "";
  document.body.appendChild(iframe);

  iframe.contentWindow.document.open();
  iframe.contentWindow.document.write("<!doctype html>"+html);
